import PropTypes from "prop-types";

// Dashboard component
const Dashboard = ({ fullStockLevel, outOfStockItems, fullTotalValue }) => {
  // Default values
  fullStockLevel = fullStockLevel || "N/A";
  outOfStockItems = outOfStockItems || 0;
  fullTotalValue = fullTotalValue || "N/A";

  // Component code remains the same
};

// Prop Types validation
Dashboard.propTypes = {
  fullStockLevel: PropTypes.number,
  outOfStockItems: PropTypes.number,
  fullTotalValue: PropTypes.number,
};

export default Dashboard;
